// Nest under App component, over Drink.js
import DrinkList from "./DrinkList";
import NewDrink from "./NewDrink";


export default function User({drinks, onAddDrink, onUpdateDrink, onDeleteDrink}){
  console.log('Hi from User component!')
  console.log(drinks)
  return(
    <div>
      <h2>User Component</h2>
      <NewDrink onAddDrink={onAddDrink} />
      <DrinkList 
        drinks={drinks}
        onUpdateDrink={onUpdateDrink} 
        onDeleteDrink={onDeleteDrink} 
      />
    </div>
  )
}
